import logo from './logo.svg';
import './App.css';

const blockRand = [
  {
    number: 1,
    color: '#2c88d9',
    position: 'col-6',
    height: '410px'
  },
  {
    number: 2,
    color: '#d3455b',
    position: 'col-6',
    height: '200px',
    childs: [
      {
        number: 2,
        color: '#d3455b',
        position: 'col-12',
        height: '200px'
      },
      {
        number: 3,
        color: '#897a5f',
        position: 'col-6 col-sm-6',
        height: '200px'
      },
      {
        number: 4,
        color: '#ac6363',
        position: 'col-6',
        height: '200px'
      }
    ]
  },
  {
    number: 5,
    color: '#763ec3',
    position: 'col-4',
    height: '200px',
    childs: [
      {
        number: 5,
        color: '#763ec3',
        position: 'col-12',
        height: '150px'
      },
      {
        number: 6,
        color: '#53af9f',
        position: 'col-12',
        height: '200px'
      }
    ]
  },
  {
    number: 7,
    color: '#387968',
    position: 'col-5',
    height: '360px'
  },
  {
    number: 8,
    color: '#6558f5',
    position: 'col-3',
    height: '200px',
    childs: [
      {
        number: 8,
        color: '#6558f5',
        position: 'col-12',
        height: '230px'
      },
      {
        number: 9,
        color: '#4b5c6b',
        position: 'col-12',
        height: '120px'
      }
    ]
  }
]

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          { blockRand.map((b) => {
            return (
              <div className={'col '+ b.position}>
                { b.childs ? (
                  <div className="row">
                    { b.childs.map((c) => {
                      return (
                        <div className={'col '+ c.position}>
                          <div style={{background: c.color, height: c.height, lineHeight: c.height, margin: 5}}>
                            {c.number}
                          </div>
                        </div>
                      )
                    })}
                  </div>
                ) : (
                  <div style={{background: b.color, height: b.height, lineHeight: b.height, margin: 5}}>
                    {b.number}
                  </div>
                )}
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
